import React from "react";
export default function InfoBar() {
	return (
		<div
			style={{
				width: "100%",
				height: "100%",
				display: "grid",
				gridTemplateColumns: "1fr 1fr",
			}}
		>
			<p style={{ fontWeight: "bold" }}>Enzost4</p>
			<p>Quotes 17</p>
		</div>
	);
}
